body {
  background: #060807;
  padding-top: 10em;
  padding-bottom: 10em;
}

.container-fluid {
  width: 100%;
  margin-left: 15px;
  margin-right: 15px;
}

//Loading
.loading {
  color: white;
}

//Navigation

.navbar {
  background-color: #060807;
}

.nav-container{
  justify-content: space-between;
}

.design-movie-logo {
  border: none;
  position: relative;

}

.container {
  padding-top: 3em;
  display: flex;
}

.main-container{
  justify-content: center;
}

.userProfile {
  margin: 2em 2em 2em 1em ;
  color: white;
}

.username {
  font-size: 2em;
  text-decoration: none;
  font-weight: bold;
  color:white;
  transition:all 0.3s ease;
  position: relative;
}

.username:hover{
  text-decoration: none;
  color:#8E081F;
}

.search{
  margin-bottom: 2em;
  width: 75%;
}

//Movie Card
.card {
  margin-bottom: 1.95em;
  position: relative;
  display: flex;
  transition:all 0.3s ease;
  border: none;
}

.card:hover {
  opacity: 0.4;
  cursor: pointer;
}

.card-img-top {
  width: 100%;
  height: auto;
  border-radius: .25em;
}

.card-title {
  position: absolute;
  color: #8E081F;
  bottom: 0;
  padding: .25em;
  background: rgba(255,255,255, 0.7);
  width: 100%;
  text-align: center;
  font-size: 1.5em;
}

//Buttons

.btn {
  background: white;
  color: black;
  transition:all 0.3s ease;
}

.btn:hover {
  background:#8E081F;
  border-color: #8E081F;
  color: white;
}

//loading screen

.loading {
  color: white;
  font-size: 3em;
}


//footer
.footer-container{
  justify-content: center;
}

.footer-link {
  color:white;
  transition:all 0.3s ease;
  padding:1em;
}

.footer-link:hover {
  color:#8E081F;
}
